    "Developing Superior Survey Protocols for Monitoring Population size of Two Endangered
    Waterbirds (Hawaiian Moorhen and Hawaiian Coot): James Campbell National Wildlife
    Refuge",nt"tracking_summary": {ntt"total": 5,ntt"recent": 0nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2016-07-27T22:56:05.718675",nt"name":
    "developing-superior-survey-protocols-for-monitoring-population-size-of-two-endangered-wate",nt"isopen":
    false,nt"url": null,nt"notes": "Alaeu2018ula (Hawiian moorhen) are quite
    secretive and current survey methods are inadequate to accurately estimate population
    size. We trapped and banded adult and juvenile individuals. We placed GPS data-loggers
    on 10 adult birds at James Campbell NWR in order to track movements. We used these
    data to develop a monitoring protocol for the Hawaiian moorhen that will allow for
    more accurate refuge and statewide population estimates. While developing a better
    method to census individuals was the primary target of this investigation, we also
    learned valuable information about moorhen response to management actions that was
    not previously understood. These data will be used across refuges in Hawaii for
    wetland management actions. Alae keu2018okeu2018o (Hawaiian coot) are much more
    likely to travel than the u2018alae u2018ula (Hawiian moorhen). Movement both within
    an island and between islands was not well understood. This affected the ability
    to accurately census the population. The goal of this component of the project was
    to better understand large-scale movements of the coots. This occured as birds were
    banded on the James Campbell and Pearl Harbor Refuges and fitted with Satellite
    PTT trackers. A band resight program utilizing volunteers based on each of the islands
    was initiated during this study.",nt"license_title": "License Not Specified",nt"extras":
